R.Quotation={Init:function(){R.Quotation.location_id=R.CurrentLocationId(),R.Quotation.culture=R.Culture(),R.Quotation.RegisterEvent()},RegisterEvent:function(){$(".paging-data").off("change").on("change",function(){var t=$(this).val();window.location.href=R.Quotation.culture+"/quotation.html?pageIndex="+t}),$(".btn-paging-pre").off("click").on("click",function(){var t=$(".paging-data").val(),n=parseInt(t)-1;window.location.href=R.Quotation.culture+"/quotation.html?pageIndex="+n}),$(".btn-paging-next").off("click").on("click",function(){var t=$(".paging-data").val(),n=parseInt(t)+1;window.location.href=R.Quotation.culture+"/quotation.html?pageIndex="+n})}},$(function(){R.Quotation.Init()});